import React from 'react';
import './DisplayImage.css';
//import Box from './box';

const DisplayImage = ({ imageUrl,top,right,bottom,left, boxFaces } ) =>{ 
    return(
        <div className='centerd ma'>
            <div className='absolute mt2'>
                <img src={imageUrl}  alt='photosss' width='500px' height='auto' id="inputImage"/>
             
            {

                boxFaces.forEach(element => {
                    return(
                    <div className='bounding-box' 
                    style={{ top: top, right: right, bottom: bottom, left: left }}>
                        </div>
                    );
                })
            }
            
               
        </div>  
        </div>
    );
            
}

export default DisplayImage;
